import React from 'react';
import { Button } from '@mui/material';

function Footer() {
  return (
    <div class="footer-container">
      <div class="footer-container-column">
          <span class="footer-container-column-title">Resources</span>
          <button onclick="location.href='https://google.com';">Open Weather Map API</button>
          <button href="https://openweathermap.org/">OpenWeatherMapAPI</button>
      </div>
      <div class="footer-container-column">
          <span class="footer-container-column-title">Developer</span>
      </div>
      <div class="footer-container-column">
          <span class="footer-container-column-title">Help</span>
      </div>
      <div class="footer-container-column">
          <span class="footer-container-column-title">Contact</span>
      </div>
    </div>
  );
}

export default Footer;
